class WifiDetailPage extends React.Component {
  render() {
    return (
      <div>
        <h2>WIFI Details</h2>
        <p>Here are the WIFI details:</p>
        <ul>
          <li>Password: **********</li>
          <li>Floor: 3rd Floor</li>
          {/* Add other necessary details */}
        </ul>
      </div>
    );
  }
}

export default WifiDetailPage;
